@YouthKiAwaaz Voters can also send an email at complaints@eci.gov.in or overseas.elector@eci.gov.in, if the case of an overseas elector. 
#JagrukVoter
#AssemblyElections2022

@YouthKiAwaaz The ECI has introduced the National Grievances Service to file all complaints, suggestions or provide information. For android phone users, the Voter Helpline App can be used.
#JagrukVoter 
#AssemblyElections2022

@YouthKiAwaaz There are multiple options available to the voters to complain and report grievances. They can send a letter to the Electoral Regional Officer, Chief Election Officer or the District Election Officer and file a complaint.
#JagrukVoter 
#AssemblyElections2022

@NyaayaIN Each voter must get their voice heard and so, #AccessibilityMatters! @ECISVEEP has several provisions for voters with disabilities. Check them out here:   
https://t.co/GxxGXN90yC 
#JagrukVoter #DemocracyAdda #AssemblyElections2022

@YouthKiAwaaz They can send the form by post and if they wish to submit it in person, the Electoral Registration Officer will verify their passport and other original documents.
#JagrukVoter 
#AssemblyElections2022

@YouthKiAwaaz They must also attach a recent passport size photograph, self attested copies of the relevant pages of the passport containing photograph and address in India and the copy of the page of the passport containing the valid visa endorsement.
#JagrukVoter 
#AssemblyElections2022

@YouthKiAwaaz An NRI will be required to fill ‘Form 6A’, available offline at the Electoral Registration Office or online at the website of the Election Commission.
#JagrukVoter 
#AssemblyElections2022

@YouthKiAwaaz Yes, they can! But,they can only vote in the constituency of the address given in your passport. 
#JagrukVoter 
#AssemblyElections2022

@NyaayaIN They sure can! There are provisions in place to allow such voters to register their vote. Read all about them here:
https://t.co/Ab5NpSFrDv 
#JagrukVoter #DemocracyAdda #AssemblyElections2022

@YouthKiAwaaz You may also carry the following documents: Smart Card issued by RGI under NPR, Health Insurance Smart Card (issued under the scheme of Ministry of Labour), Official Identity Cards issued to MPs/MLAs/MLCs
#JagrukVoter 
#AssemblyElections2022

@YouthKiAwaaz Some of the alternatives are : Aadhaar Card, MNREGA Job Card, Passbook issued by Bank/Post Office with photo, Driving License, Service Identity Cards issued to government officers, Passport, Pension Document (with photo)
#jagrukvoter 
#AssemblyElections2022

@YouthKiAwaaz Yes, of course, you can still vote, as long as you have another government approved identity proof with you!

#jagrukvoter 
#AssemblyElections2022

@YouthKiAwaaz In case you are moving to another constituency, first unregister yourself from your previous constituency and re-register yourself as a new voter by filling in the Form 6.

#jagrukvoter 
#AssemblyElections2022

@YouthKiAwaaz To change address details in the same constituency, please fill Form 8A and submit it either online or physically to the Electoral Registration Officer.

#Jagrukvoter 
#AssemblyElections2022

@YouthKiAwaaz For any inadvertent errors related to date of birth or other personal details on the election identify card, fill in the Form 8 and submit it either online or physically to the Electoral Registration Officer. 
#Jagrukvoter 
#AssemblyElections2022

